function GetDatalabelsInsideEnd(chartId, chart, isStack) {
  var textColl = $('#'+chartId+' .c3-texts text');
  var barColl = $('#'+chartId+' .c3-shapes path');
  for (var i = 0; i < barColl.length; i++) {
    if (chart === 'bar') {
      var textWidth = textColl[i].getBoundingClientRect().width;
      var barWidth = barColl[i].getBoundingClientRect().width;
      if (parseInt(barWidth) - parseInt(textWidth) < 2) d3.select(textColl[i]).text('');
      else {
        var datalabelY = d3.select(textColl[i]).attr('x');
        var newDatalabelY = parseInt(datalabelY);
        newDatalabelY = isStack ? (newDatalabelY - textWidth - 5) : (newDatalabelY - 20);
        d3.select(textColl[i]).attr('x', newDatalabelY);
      }
    } else {
      var textHeight = textColl[i].getBoundingClientRect().height;
      var barHeight = barColl[i].getBoundingClientRect().height;
      if ((parseInt(barHeight) + 5) < parseInt(textHeight)) d3.select(textColl[i]).text('');
      else {
        var datalabelY = d3.select(textColl[i]).attr('y');
        var newDatalabelY = parseInt(datalabelY) + 15;
        d3.select(textColl[i]).attr('y', newDatalabelY);
      }
    }
  }
}  
